import React, { useState } from "react";
import { Grid } from "@material-ui/core";
import OurWork from "./OurWork";
import Button from "../Button";
import styled from "styled-components";

function OurWorks() {
    const [featured] = useState([
        {
            title: "KEMIS YELEBESKU LET",
            image: "assets/kemis-yelebesku.png",
            type: "Feature Film",
        },
        {
            title: "TEDDY AFRO - MAR ESKE TUAF",
            image: "assets/teddy-afro.png",
            type: "Music Video",
        },
        {
            title: "EWUR AMORA KELABI",
            image: "assets/ewuramora.png",
            type: "Documentary",
        },
        {
            title: "JAON BEER",
            image: "assets/jano.png",
            type: "Advertising",
        },
    ]);

    return (
        <Wrapper>
            <Grid container direction="column" alignItems="center" spacing={3}>

                <Grid container item>
                    {featured.map((f, key) => (
                        <Grid spacing={3} key={key} item xs={12} sm={12} md={6}>
                            <OurWork {...f} />
                        </Grid>
                    ))}
                    <Button>Learn More</Button>
                </Grid>
            </Grid>
        </Wrapper>
    );
}

const Wrapper = styled.div`
text-align:center;
justify-content:center;
`;

export default OurWorks;
